import React from 'react'
import { useContext, useState, useEffect } from 'react'
import Contexto from '../Contexto/Contexto'
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Pedidos() {

  const {usuario} = useContext(Contexto);
  const [dataPedidos, setDataPedidos] = useState()
  const navigate = useNavigate();
  let pedidos = [];


  // useEffect(() => {
    axios.post(`http://localhost:8080/api/encontrarPed/${usuario.id}`)
      .then(response => {
        setDataPedidos(response.data);
      })
      .catch(error => {
        console.error('Error al obtener los datos:', error);
      });
  // }, [usuario.id]);

  if(dataPedidos.length > 0){
    for(var i = 0; i < dataPedidos.length; i++){
      pedidos.push(JSON.parse(dataPedidos[i].pedido));
    }
  }
  else{
    alert("No tiene pedidos aun")
  }
  

  const volver = () => {
    navigate('/');
  }


  return (
    <div>
      {console.log(dataPedidos)}
      <button onClick={()=>volver()}>Volver</button>
    </div>
  )
}

export default Pedidos
